import React from 'react';

// CSS
import styles from './Input.module.css';

const Input = (props) => {
    const propsClasses = [styles.Input];
    if (props.className) {
        propsClasses.push(props.className);
        console.log(propsClasses.join(' '))
    }
    return (
        <input
            className={propsClasses.join(' ')}
            {...props} />
    );
};

export default Input;
